def checkPrime(n):
    if n <= 1:
        return False
    if n <= 3:
        return True
    if n % 2 == 0 or n % 3 == 0:
        return False
    c = 5
    while c * c <= n:
        if n % c == 0 or n % (c + 2) == 0:
            return False
        c += 6
    return True
